import React, { Component } from "react";

class AboutSection extends Component {
  state = {};
  render() {
    return (
      <div>
        <div
          style={{
            height: 20,
            width: 20,
            backgroundColor: "black",
            display: "flex",
            alignItems: "center",
            gridArea: "desc",
          }}
        >
          <div
            style={{
              fontSize: 30,
              fontFamily: "Unna",
              fontStyle: "italic",
              fontWeight: "bold",
              position: "relative",
              left: "150%",
            }}
          >
            About
          </div>
        </div>
      </div>
    );
  }
}

export default AboutSection;
